import UserProfileC from "./UserProfile.module.css"

function UserProfile(props) {
    console.log(props);
    return (
        <div className={UserProfile.module.css.card}>
            <h2 className={UserProfileC.name}>{props.name}</h2>
            <span className={UserProfileC.age}>{props.age}</span>
            <img src={props.URL} className={UserProfileC.avatarURL}/>
        </div>
    )
}

export default UserProfile
